import "./App.css";
import { Route } from "react-router-dom";
import LandingPage from "./Components/LandingPage";
import WheelPage from "./Components/WheelPage";

function App() {
  return (
    <div>
      <Route path="/" exact>
        <LandingPage />
      </Route>
      <Route path="/try-your-luck">
        <WheelPage />
      </Route>
    </div>
  );
}

export default App;
